    message += "NAME " + name + "\n"
    message += "POSITION " + position + "\n"
    message += "DAYS_WORK " + daysWork + "\n"
    message += "START_WORKING_HOURS " + startWorkingHours + "\n"
    message += "END_WORKING_HOURS " + endWorkingHours + "\n"
